import React from "react";
import "./Table.css";
import numeral from "numeral";

function Table(revenueInfo) {
  return (
    <div className="table">
      {revenueInfo.map((region) => (
        <tr>
          <td>{region}</td>
          <td>
            <strong>{numeral(revenueInfo.region).format("0,0")}</strong>
          </td>
        </tr>
      ))}
    </div>
  );
}

export default Table;
